import React from "react";

const Avatar = ({ children }) => {
    const Style = {
    backgroundColor,
    padding,
    color,
    borderRadius,
    fontSize,
    textAlign,
    };
    return;
    <div style={Style}>{children}</div>;
};

export default Avatar;
